import React from 'react';
import logo from './logo.svg';
import './TopAdoptionRates.scss';
import PercentCircle from './PercentCircle';
import DynamicGrid from './DynamicGrid';
import TextDisplay from './TextDisplay';

function TopAdoptionRates() {

  const percentage = 80;
  const gridData = [
    { heading: 'Template', content: 'John Doe' },
    { heading: 'AdoptionRate', content: '30' },
    { heading: 'Email', content: 'johndoe@example.com' },
    // Add more rows of data as needed
  ];

  return (
    <div className="topAdoptionRates">
      <div className={"title"}>
        <h4>Top Template Adoption Rates</h4>
      </div>
      <div className={"topAdoptionRow"}>
        <PercentCircle
          title={"Adoption Rate"}
          titleColor={'#b4bfd5'}
          percentage={percentage}
          size={150}
          strokeWidth={10}
          circleColor={"#305bf5"}
          textColor={"#fff"}
          emptyColor={"#1D2435"}
        />
        <TextDisplay title={"Most Adopted Template"} textContent={"fly-docker-imagea"} />

        </div>


    </div>
  );
}

export default TopAdoptionRates;
